     /// <summary>
     /// Manages 360's Avatar gamer service. Ensures duplicate Avatar Descriptions, 
     /// Animations, etc, are not loaded.
     /// 
     /// The Player's Avatar information will be built upon game-start, and kept
     /// in memory to ensure faster loading (since the Player's Avatar will be 
     /// nearly everywhere in Avatar Typing).
     /// </summary>
     public class AvatarManager : DrawableGameComponent
     {
          #region Singleton

          /// <summary>
          /// The singleton for the Avatar Manager.
          /// </summary>
          private static AvatarManager avatarManager = null;

          #endregion

          #region Fields

          private List<Avatar> avatarList = new List<Avatar>();
          private List<Avatar> uniqueAvatarList = new List<Avatar>();

          private uint uniqueAvatars = 0;

          public static Dictionary<string, CustomAvatarAnimationPlayer> LoadedCustomAnimations =
                    new Dictionary<string, CustomAvatarAnimationPlayer>();

          public static Dictionary<string, CustomAvatarAnimationData> LoadedAvatarAnimationData =
                    new Dictionary<string, CustomAvatarAnimationData>();

          // NEW
          public static Dictionary<string, AvatarBaseAnimation> LoadedPresetAvatarAnimation =
               new Dictionary<string, AvatarBaseAnimation>();

          #endregion

          #region Properties

          /// <summary>
          /// Returns the singleton instance of Avatar Manager.
          /// </summary>
          public static AvatarManager GetInstance
          {
               get { return avatarManager; }
          }

          /// <summary>
          /// Returns a List of Avatar objects currently being managed.
          /// </summary>
          public List<Avatar> AvatarList
          {
               get { return avatarList; }
          }

          /// <summary>
          /// Quicker way to return the number of Avatar objects being managed.
          /// </summary>
          public int Count
          {
               get { return avatarList.Count; }
          }

          /// <summary>
          /// Returns the number of unique (in AvatarDescriptions) avatars currently being managed.
          /// </summary>
          public int UniqueAvatarCount
          {
               get 
               {
                    // We know the first Avatar is unique--at least for now.
                    if (avatarList.Count > 0)
                    {
                         uniqueAvatarList.Add(avatarList[0]);
                    }

                    else
                    {
                         return 0;
                    }

                    // Iterate through AvatarList...
                    foreach (Avatar avatar in avatarList)
                    {
                         // For each element in AvatarList, compare it to those in UniqueAvatarList.
                         foreach (Avatar uniqueAvatar in uniqueAvatarList)
                         {
                              if (avatar.AvatarDescription != uniqueAvatar.AvatarDescription)
                              {
                                   uniqueAvatarList.Add(avatar);
                              }
                         }
                    }

                    return uniqueAvatarList.Count;
               }
          }

          public uint NumberOfUniqueAvatars
          {
               get { return uniqueAvatars; }
               set { uniqueAvatars = value; }
          }

          #endregion

          #region Initialization

          /// <summary>
          /// Avatar Manager Constructor.
          /// </summary>
          /// <param name="game"></param>
          private AvatarManager(Game game)
               : base(game)
          {
          }

          /// <summary>
          /// Initialize the Avatar Manager DrawableGameComponent.
          /// </summary>
          /// <param name="game"></param>
          public static void Initialize(Game game)
          {
               avatarManager = new AvatarManager(game);

               if (game != null)
               {
                    game.Components.Add(avatarManager);
               }
          }

