               Avatar newAvatar = new Avatar(PixelEngine.EngineCore.Game, new Vector3(0, 0, 5f));

               // Check to see if the user is signed in
               if (Gamer.SignedInGamers[EngineCore.ControllingPlayer.Value] != null)
               {
                    // Get the users avatar description
                    //newAvatar.AvatarDescription = Gamer.SignedInGamers[EngineCore.ControllingPlayer.Value].Avatar;
                    
                    // Change To:
                    IAsyncResult avatarResult;
                    avatarResult = AvatarDescription.BeginGetFromGamer(Gamer.SignedInGamers[EngineCore.ControllingPlayer.Value], null, null);
                    newAvatar.AvatarDescription = AvatarDescription.EndGetFromGamer(avatarResult);
                    
                    // If this is not valid the user doen't have an avatar
                    if (!newAvatar.AvatarDescription.IsValid)
                    {
                         newAvatar.AvatarDescription = AvatarDescription.CreateRandom();
                    }

                    newAvatar.AvatarRenderer = new AvatarRenderer(newAvatar.AvatarDescription, true);
                    newAvatar.PlayAnimation(AvatarAnimationPreset.Celebrate, true);
               }

               newAvatar.Position = new Vector3(0, 0, 5);
               newAvatar.Rotation = new Vector3(0, 180, 0);
               newAvatar.Scale = 1.0f;

               avatarList.Add(newAvatar);
          }

          public void AddRandomAvatar(AvatarAnimationPreset animation)
          {
               Avatar newAvatar = new Avatar(PixelEngine.EngineCore.Game);
               newAvatar.AvatarDescription = AvatarDescription.CreateRandom();
               newAvatar.AvatarRenderer = new AvatarRenderer(newAvatar.AvatarDescription, true);
               newAvatar.PlayAnimation(animation, true);
  
               avatarList.Add(newAvatar);
          }

